import React from 'react';
import Auth from '../auth';
import Input from '../../input';
import './login.css'

const login=(props)=>{





return( 
<Auth>
        
        <form>
        <h2>Login</h2>
  <Input  id = 'email'
        onChange={(event)=>this.inputChangedHandler(event,'title')} 
        elementType='email' 
        label='Email'/>
 
    <Input 
        id = 'password'
        onChange={(event)=>this.inputChangedHandler(event,'title')} 
        elementType='password' 
        label='Password'/>
        
        <button className="Btn">Signup</button>
        </form>
    </Auth>
)
}


export default login;
